import React, { Component, Fragment }from 'react';
import { BrowserRouter as Router,Switch,Route, Redirect } from "react-router-dom";
import Header from './components/Header';
import Footer from './components/Footer';
import Detailview from './components/DetailView/Detailview';
import ElectronicList from './components/ProductList/ElectronicList';
import GroceryList from './components/ProductList/GroceryList';
import PhoneList from './components/ProductList/PhoneList';
import TabletList from './components/ProductList/TabletList';
import JewelryList from './components/ProductList/JewelryList';
import ElectronicView from './components/'
class App extends Component {

render(){
  return(
    <Router>
   <Fragment>
      <Switch>
        <Route exact path="/" component={Header}/>
        <Route exact path="/electronics" component={ElectronicList}/>
        <Route exact path="/electronics/:productID/" component={ElectronicView}/>
        <Route exact path="/grocery" component={GroceryList}/>
        <Route exact path="/grocery/:productID/" component={Detailview}/>
        <Route exact path="/phones" component={PhoneList}/>
        <Route exact path="/phones/:productID/" component={Detailview}/>
        <Route exact path="/tablets" component={TabletList}/>
        <Route exact path="/tablets/:productID/" component={Detailview}/>
        <Route exact path="/jewelry" component={JewelryList}/>
        <Route exact path="/jewelry/:productID/" component={Detailview}/>
        <Route exact path="/product/:productID/" component={Detailview}/>
      </Switch>
     <Footer/>
    </Fragment>

  </Router>
  )};

}

export default App;
